import React, { Component } from 'react'

export default class Logo extends Component {
    render() {
        return (
            <div>
                <a className="navbar-brand" href="./home.html">
                <img src="./logo.jpg" className="logo" alt="" />
                </a>

            </div>
        )
    }
}
